import React from 'react';

/**
 * TopBar 
 * 
 * @description Component to create the top bar of the page
 */

const TopBar = () => {
    return (
        <div className='header'>
            <div className='logo'> Schedulsaur </div>
        </div>
    )
}


export default TopBar;
